INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES (1, 'es', 'Casa de Gobierno', 'Es uno de los lugares más importantes que tiene la Provincia de Misiones a nivel institucional, ya que aquí se tratan institucionalmente todos los temas más importantes que ocurren en el territorio provincial, es también el lugar físico donde cumple sus funciones la máxima autoridad, el Gobernador.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(2, 'es', 'Catedral San José', 'La Catedral de Posadas tiene alineamientos de la arquitectura romántica, tanto francesa como italiana. Las torres con sus trabajados capiteles terminan en cruces de hierros, mientras que el aspecto general del templo es basilical. La obra se terminó en 1937.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(3, 'es', 'Parque Paraguayo', 'Históricamente se trató de un mirador de la ciudad de Posadas, que está ubicado en la punta Norte de la ciudad. Constituyó, durante muchos años, el único mirador de la ciudad, el punto de contacto directo a la vista con la costa del país vecino. Debe su nombre al monumento levantado por el propio pueblo paraguayo.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(4, 'es', 'Av. Costanera Monseñor J. Kemerer', 'Es la Avenida que bordea al río Paraná en la ciudad de Posadas, siendo una de las zonas más importantes de la ciudad. A lo largo de esta avenida, se encuentran diferentes lugares de interés.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(5, 'es', 'Museo Regional Aníbal Cambas','El museo posee colecciones de las culturas altoparanaense, umbú, eldoradense, tupí-guaraní, guayakí, jesuítico-guaraní y sobre la Edad Contemporánea en la provincia. Es el más antiguo de la ciudad.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(6, 'es', 'Anfiteatro Manuel Antonio Ramírez', 'En los últimos años ha sido sede de diferentes fiestas y espectáculos como la Fiesta Nacional de la Música del Litoral, y la Estudiantina. Cuenta con una capacidad para 4.000 personas, y brinda el espacio para realizar todo tipo de espectáculos con el Río Paraná en el paisaje.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(7, 'es', 'Jardín Botánico Alberto Roth', 'Los jardines botánicos son espacios donde se crean reservas ecológicas para garantizar una mejor calidad de vida a las especies que lo habitan, un lugar donde diversas especies, algunas en peligro de extinción, puedan apreciarse, así como un espacio abierto para la investigación y la educación. Cuenta con senderos para recorrer el lugar.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(8, 'es', 'Paseo Bosetti', 'Cuenta con paneles realizados por artistas plásticos que retratan la historia de la ciudad, así como un monumento al Matero. Una fuente con cascada, caracterizada por saltos de agua naturales, y algunas especies arbóreas autóctonas y exóticas, completan este atractivo paseo que, además, cuenta con una conexión directa con el Palacio del Mate y el Museo de Bellas Artes, conformando unidos un hito destacado dentro del centro la ciudad de Posadas. También cuenta con puestos donde artesanos pueden ofrecer sus productos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(9, 'es', 'Paseo Cultural La Terminal', 'La antigua terminal de ómnibus de la ciudad estaba ubicada en la esquina de una de las avenidas que forman el casco céntrico, por lo que cuando la ciudad fue creciendo ésta quedó pequeña y se decidió mudarse a otra ubicación. En este lugar se estableció lo que hoy se conoce como Paseo Cultural La Terminal donde los turistas pueden disfrutar de diferentes representaciones artísticas y se desarrollan actividades culturales.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(10, 'es', 'Piedra Fundacional Itapúa', 'La piedra fundacional de Posadas, indica el sitio aproximado en donde, un 25 de marzo de 1615 el se fundó la Reducción Jesuítica del mismo nombre y que es tomada como el antecedente más importante de lo que más adelante sería la Ciudad de Posadas.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(11, 'es', 'Plaza 9 de Julio','La Plaza 9 de Julio cuenta con la tradicional estatua de La Libertad y un variado muestrario de especies vegetales de Misiones. Se encuentra frente a la Casa de Gobierno, la Iglesia Catedral, edificios de modernos hoteles, casas bancarias y comercios. ');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(12,'es', 'Plaza San Martín', 'Aquí se exhibe la estatua del Libertador de América, el General José Francisco de San Martín; vistosos jardines y juegos para niños. Frente al Instituto Superior Antonio Ruiz de Montoya, primera casa de estudios superiores de la provincia de Misiones');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(13, 'es', 'Reserva Urbana Rincón Nazarí', 'Es única en su tipo en la provincia de Misiones. Siendo un emprendimiento privado, está ubicada a pocas cuadras del centro de la ciudad de Posadas.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(14, 'es', 'Museo Histórico y Arqueológico Andrés Guacurarí','Se encuentra ubicado en el casco céntrico de la ciudad, posee elementos de las culturas altoparanaense, mocoretá, eldoradense, tupí-guaraní, como así también elementos de las misiones jesuíticas guaraníes.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(15, 'es', 'Museo Municipal de Bellas Artes Lucas Braulio Areco-Palacio del Mate', 'El museo cuenta con varios dioramas y fotografías que ilustran la evolución histórica de la hoy ciudad y el área circundante. Hay cuadros y esculturas de artistas locales, y objetos antiguos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(16, 'es', 'Museo Provincial Juan Yaparí', 'Las salas del Museo Provincial de Bellas Artes Juan Yaparí están destinadas a exposiciones temporales con el objetivo de fomentar, promover, difundir y jerarquizar la producción de los artistas plásticos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(17, 'es', 'Playa El Brete', 'Es una playa de Río, a orillas del Río Paraná, ubicada muy cerca del centro de la ciudad. Ofrece actividades recreativas, como kayak y canchas para realizar algunos deportes. También cuenta con locales con ofertas gastronómicas en su cercanía.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(18, 'es', 'Costa Sur', 'En el acceso sur de la ciudad de Posadas se encuentra uno de los puntos habilitados para actividades recreativas y de balneario en la costa del río Paraná. Los visitantes pueden disfrutar de la playa, gastronomía y deportes en un solo lugar.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(19, 'es', 'Parque La Cantera (Cascada)', 'Se trata de un salto artificial con una caída de agua de quince metros de altura rodeado por una plaza. Está ubicada en lo que fue la histórica cantera de la empresa Enríquez, que le da el nombre.En el lugar se permite la realización de espectáculos y actividades al aire libre. Es un punto de reunión para las familias que deciden ir a pasar una tarde con vista al río, además cuenta con juegos y actividades para niños, sanitarios y puestos de feriantes los fines de semana.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(20, 'es', 'Monumento A Andresito Guacurarí','Se trata de una imponente estructura de acero inoxidable que está localizada en el segundo tramo de la costanera, a metros de la rotonda de la bajada vieja.Con 17 metros de alto y 6 toneladas de peso, de cara la ciudad de Posadas y de fondo el río Paraná. Es el punto más fotografiado de la ciudad.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(21, 'es', 'Mirador de la Calle Moritán', 'En este punto del paseo, construido sobre un barranco natural que mira hacia el río Paraná, se puede tener una vista panorámica privilegiada de diferentes partes de la ciudad e inclusive de Encarnación en Paraguay.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(22, 'es', 'Escalera Pintada', 'Es una cascada cascada pintada en las escalinatas de la Costanera que busca resaltar la majestuosidad de la naturaleza misionera, y que cobra más vida en los días de lluvia. Fue realizada por el artista Bernado Neumann en 2016.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(23, 'es', 'Ex Estación de Trenes (Villa Cultura La Estación)','El edificio es una réplica exacta de la estación de trenes original de la ciudad de Posadas, terminal del servicio Federico Lacroze - Posadas llamado el Gran Capitán que fue inaugurada en 1913 y funcionó hasta el año 2011. Fue declarada Patrimonio Cultural de la ciudad, y donde se suelen realizar exposiciones artísticas y culturales.“Se restauraron sus características paredes de granito, sus anchas galerías techadas, sus boleterías y sus pizarras, las locomotoras “La Posadeña” y “La Misionerita” que podemos ver sobre sus rieles en el amplio parque que la rodea y algunas piezas que se suponían extraviadas.”');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(24, 'es', 'Muelle de pescadores', 'Es un muelle que se posa unos metros adentro de las costas del Río Paraná en las cercanías del Brete. Brinda unas vistas extraordinarios al país vecino así como es una excelente opción para observar el atardecer.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(25, 'es', 'Mirador Estación', 'Se trata de una pasarela puente sobre el Río Paraná, donde se puede tener una hermosa vista del río y de la ciudad. Además, brinda una vista distinta de la Av. Costanera y del país vecino Paraguay. Se puede observar también el puente internacional, lo que lo hace un lugar ideal para tomar fotos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(26, 'es', 'Templo Budista Rattanarngsiyaram','Es el Templo budista de la comunidad laosiana de la ciudad. El templo Wat Lao Rattanarangsyaram Keosawang alberga el Buda considerado como el más grande de Latinoamérica con 14 metros de altura.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(27, 'es', 'Plazoleta El Papa','Ubicada donde anteriormente se encontraba el puerto de la ciudad, cuenta con una vista panorámica del río en medio de todo el movimiento de la costanera. Esta plaza es un punto de reunión de jóvenes y adultos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(28, 'es', 'Kayak', 'Una actividad recreativa disponible en el Río Paraná, que ofrece a los visitantes la oportunidad de explorar las aguas y disfrutar del entorno natural.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(29, 'es', 'Macro Bici', 'Un servicio de alquiler de bicicletas que permite a los visitantes recorrer la ciudad de Posadas de manera ecológica y activa.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(30, 'es', 'Catamarán', 'Una experiencia de paseo en barco por el Río Paraná, ofreciendo impresionantes vistas de la ciudad y los paisajes circundantes.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(31, 'es', 'Monumento a los “Veteranos de Malvinas', 'Este monumento rinde homenaje a los soldados argentinos que participaron en la Guerra de Malvinas de 1982. Representa un reconocimiento eterno a su valentía, entrega y compromiso con la patria. Es un espacio de memoria y reflexión, donde se honra a los caídos y se valora el sacrificio de quienes regresaron.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(32, 'es', 'Monumento Ñañua', 'La escultura simboliza el abrazo entre dos pueblos “Ñañuã”. La obra tiene 9.20 metros de altura y el arquitecto fue electo en el concurso “La Frontera nos une” convocado por la Entidad con la idea que la escultura ganadora se convierta en un hito urbano e innovador que contribuya al proceso e reconocimiento de la identidad y significado cultural del espacio público, destacando la integración y hermandad de los pueblos de la Argentina y del Paraguay.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(33, 'es', 'Estatua de San Roque González de Santa Cruz', 'Roque González de Santa Cruz fue un joven mártir primer santo paraguayo, nacido en Asunción del actual Paraguay, fundador de varias reducciones entre ellas las ciudades de Posadas y de Encarnación.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(34, 'es', 'Sitio de la Memoria, plazoleta y monumento Reforma Universitaria', 'Es un monumento en homenaje a la Verdad y la Memoria en la plazoleta de la Reforma Universitaria. Es un espacio abierto, con un elemento central que propone el ejercicio de la memoria como una construcción colectiva. La plazoleta Reforma Universitaria, sobre la avenida Corrientes, está emplazada donde funcionó por muchos años el comedor de la UNaM.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(35, 'es', 'Monumento a las Sagradas Escrituras', 'Rodeada de canteros de flores, la construcción erigida en honor a las Sagradas Escrituras cuenta con dos caminos de entrada frontal, en los que se ubican sendas placas con pasajes bíblicos “para meditar”. Los soportes simulan ser los dos pilares de bronce que se encontraban en el pórtico del Templo de Jerusalén: mientras el de la derecha llevaba el nombre de Jaquin, el de la izquierda es el de Boaz.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(36, 'es', 'Corpóreo Ciudad', 'El Corpóreo “Posadas” es un cartel monumental con el nombre de la ciudad, ubicado estratégicamente en la costanera, frente al río Paraná. Pensado como un símbolo de identidad local y orgullo urbano, este punto se ha convertido en uno de los favoritos tanto para residentes como para turistas que buscan llevarse una foto inolvidable de su paso por la capital misionera.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(37, 'es', 'Mirador del Cerro Pelón', 'El Cerro Pelón es el primer testigo del nacimiento de la ciudad que creció junto al río Paraná. Este lugar muy cercano y pegado a lo que es y fue la Bajada Vieja y sus habitantes.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(38, 'es', 'Reserva Urbana Arroyo Itá', 'En la Reserva natural urbana Arroyo Itá habitan más de 100 especies de aves, otras tantas de árboles y 40 variedades de peces. Además se encuentran numerosas mariposas, insectos, cuises, coipos, carpinchos y lagartos overos entre otros animales.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(39, 'es', 'Plaza de los Mástiles', 'La Plaza de los Mástiles es un espacio público emblemático, conocido por su conjunto de mástiles que izan con orgullo las banderas nacionales y provinciales. A metros del Puente Internacional San Roque González de Santa Cruz.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(40, 'es', 'Parque de las Fiestas', 'El Parque de las Fiestas es un espacio verde pensado para el encuentro, la celebración y la recreación de toda la comunidad. Su nombre refleja el espíritu festivo y participativo del lugar, donde se llevan a cabo eventos culturales, ferias, espectáculos y actividades al aire libre durante todo el año. Rodeado de árboles y amplios espacios abiertos, es ideal para disfrutar en familia o con amigos, ya sea en jornadas de descanso o durante festividades populares.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(41, 'es', 'Plaza Anfiteatro el Brete', 'Anfiteatro ubicado en el último tramo construido de la Costanera, a orillas de la bahía El Brete, y del cual recibe su nombre. Se encuentra en una plaza que cuenta con espacios verdes para disfrutar del día.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(42, 'es', 'El varadero', 'Rememora lo que hasta la década de 1.950 existió a pocos metros de este lugar donde se encuentra el mural, un varadero que brindaba servicios y tareas de mantenimiento a las embarcaciones que surcaban las aguas del río Paraná.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(43, 'es', 'El mensú', 'En este sitio se homenajea al personaje fundamental de la denominada “economía extractiva”, justamente por el hecho de que los mensúes eran los obreros encargados de extraer los bienes que propiciaba la selva, yerba mate y madera.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(44, 'es', 'Mural Camino al Mensú', 'Este mural confeccionado con la técnica del mosaiquismo, representa a un mensú flotando en el agua con un manto de sangre desprendiéndose de su vientre. Esto alude a que en esos tiempos, era común ver cadáveres de mensúes rebeldes flotando sobre las aguas del río Paraná, ya que por el trabajo sacrificado y esclavizante que llevaban a cabo en las selvas del Alto Paraná era lógico que surgieran reclamos y rebeliones que eran sofocadas por los kapangas, capataces en los obrajes, los cuales impunemente asesinaban a los peones y los tiraban a las aguas del río.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(45, 'es', 'Mural Costanera', 'El mural consta de dos partes: una intervenida con pintura como un gran relato que cuenta la historia de la zona desde los guaraníes y los jesuitas hasta la actualidad, y otra de 160 metros cuadrados sobre el mismo tema pero hecha con lápiz negro, que es la que logró el récord Guinness en el año 2018.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(1, 'en', 'Government House', 'It is one of the most important institutional places in the Province of Misiones, as all major issues occurring in the provincial territory are addressed here. It is also the physical location where the highest authority, the Governor, carries out their duties.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(2, 'en', 'Saint Joseph Cathedral', 'The Cathedral of Posadas features alignments of romantic architecture, both French and Italian. The towers, with their elaborate capitals, end in iron crosses, while the overall appearance of the temple is basilical. The construction was completed in 1937.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(3, 'en', 'Paraguayan Park', 'Historically, it was a viewpoint of the city of Posadas, located at the northernmost tip of the city. For many years, it was the only viewpoint in the city, providing direct visual contact with the neighboring country’s coast. It is named after the monument erected by the Paraguayan people.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(4, 'en', 'Coastal Avenue Monseñor J. Kemerer', 'This avenue runs along the Paraná River in the city of Posadas and is one of the most important areas of the city. Along this avenue, visitors can find various places of interest.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(5, 'en', 'Aníbal Cambas Regional Museum', 'The museum holds collections from the Alto Paraná, Umbú, Eldoradense, Tupí-Guaraní, Guayakí, and Jesuit-Guaraní cultures, as well as exhibits on the Contemporary Age in the province. It is the oldest museum in the city.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(6, 'en', 'Manuel Antonio Ramírez Amphitheater', 'In recent years, it has hosted various festivals and shows, such as the National Festival of Litoral Music and the Estudiantina. It has a capacity of 4,000 people and provides a space for all kinds of performances, with the Paraná River as a scenic backdrop.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(7, 'en', 'Alberto Roth Botanical Garden', 'Botanical gardens serve as ecological reserves to ensure a better quality of life for the species that inhabit them. They provide a refuge for various species, including some endangered ones, and offer an open space for research and education. The site includes trails for visitors.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(8, 'en', 'Bosetti Promenade', 'It features panels created by visual artists depicting the city’s history, as well as a monument to the "Matero" (a person who drinks mate). A cascading fountain, natural water jumps, and a mix of native and exotic trees complete this attractive promenade. It also has a direct connection to Palacio del Mate and the Museum of Fine Arts, forming a prominent landmark in downtown Posadas. There are also stalls where artisans can sell their products.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(9, 'en', 'Cultural Walk La Terminal', 'The old bus terminal of the city was located at the corner of one of the avenues in the central district. As the city grew, it became too small, leading to its relocation. This space was transformed into what is now known as Paseo Cultural La Terminal, where tourists can enjoy different artistic performances and cultural activities.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(10, 'en', 'Itapúa Foundational Stone', 'The foundational stone of Posadas marks the approximate location where, on March 25, 1615, the Jesuit Reduction of the same name was founded. It is considered the most significant historical precedent of what would later become the City of Posadas.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(11, 'en', '9th of July Square', 'Plaza 9 de Julio features the traditional Statue of Liberty and a diverse display of Misiones’ native vegetation. It is located in front of the Government House, the Cathedral Church, modern hotels, banks, and commercial buildings.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(12, 'en', 'Saint Joseph Cathedral', 'This square showcases the statue of the Liberator of America, General José Francisco de San Martín, along with beautiful gardens and children’s playgrounds. It is situated in front of the Antonio Ruiz de Montoya Higher Institute, the first institution of higher education in the province of Misiones.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(13, 'en', 'Rincón Nazarí Urban Reserve', 'It is unique in its kind within the province of Misiones. As a private initiative, it is located just a few blocks from downtown Posadas.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(14, 'en', 'Andrés Guacurarí Historical and Archaeological Museum', 'Located in the city center, the museum exhibits artifacts from the Alto Paraná, Mocoretá, Eldoradense, Tupí-Guaraní cultures, as well as items from the Jesuit-Guaraní missions.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(15, 'en', 'Lucas Braulio Areco Municipal Museum of Fine Arts - Palacio del Mate', 'The museum features various dioramas and photographs illustrating the historical evolution of the city and its surroundings. It also displays paintings and sculptures by local artists, along with antique objects.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(16, 'en', 'Juan Yaparí Provincial Museum', 'The exhibition halls of the Juan Yaparí Provincial Museum host temporary exhibitions with the aim of promoting, fostering, and showcasing the work of visual artists.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(17, 'en', 'El Brete Beach', 'This is a river beach on the shores of the Paraná River, located near the city center. It offers recreational activities such as kayaking and sports courts. There are also nearby restaurants with gastronomic options.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(18, 'en', 'South Coast', 'Located in the southern entrance of Posadas, this area is one of the authorized recreational and beach spots on the Paraná River coast. Visitors can enjoy the beach, gastronomy, and sports all in one place.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(19, 'en', 'Cultural Walk La Terminal', 'This is an artificial waterfall with a fifteen-meter drop, surrounded by a plaza. It is located in the historic quarry of the Enríquez company, which gives it its name. The site allows for outdoor events and activities. Families often gather here to enjoy a riverside afternoon, with play areas for children, restrooms, and vendor stalls on weekends.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(20, 'en', 'Monument to Andresito Guacurarí','This is an impressive stainless steel structure located in the second section of the waterfront, near the Bajada Vieja roundabout. Standing 17 meters tall and weighing 6 tons, it faces the city of Posadas with the Paraná River as its backdrop. It is the most photographed landmark in the city.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(21, 'en', 'Moritán Street Viewpoint', 'This viewpoint, built on a natural cliff overlooking the Paraná River, offers a privileged panoramic view of various parts of the city, including Encarnación in Paraguay.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(22, 'en', 'Painted Staircase', 'It is a painted waterfall on the stairways of the waterfront, designed to highlight the majesty of Misiones’ natural beauty. The artwork becomes even more vivid on rainy days. It was created by artist Bernardo Neumann in 2016.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(23, 'en', 'Former Train Station (Villa Cultura La Estación)', 'The building is an exact replica of the original train station of Posadas, which was the terminal for the Federico Lacroze - Posadas service known as "El Gran Capitán," inaugurated in 1913 and operational until 2011. It was declared a Cultural Heritage site of the city and is now used for artistic and cultural exhibitions.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(24, 'en', 'Fishing Pier', 'This is a pier extending a few meters into the Paraná River near El Brete. It offers extraordinary views of the neighboring country and is an excellent spot to watch the sunset.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(25, 'en', 'Station Viewpoint', 'This is a bridge walkway over the Paraná River, providing a stunning view of the river and the city. It also offers a different perspective of Costanera Avenue and Paraguay. The international bridge is visible from here, making it an ideal spot for photography.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(26, 'en', 'Rattanarngsiyaram Buddhist Temple','This is the Buddhist temple of the Laotian community in the city. The Wat Lao Rattanarangsyaram Keosawang temple houses the Buddha considered the largest in Latin America, standing at 14 meters high.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(27, 'en', 'El Papa Square','Located where the city’s former port used to be, this small square offers a panoramic view of the river amidst the busy waterfront area. It serves as a gathering spot for both young and older visitors.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(28, 'en', 'Kayak', 'A recreational activity available on the Paraná River, offering visitors the opportunity to explore the waters and enjoy the natural surroundings.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(29, 'en', 'Macro Bike', 'A bike rental service that allows visitors to explore the city of Posadas in an eco-friendly and active way.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(30, 'en', 'Catamarán', 'A boat tour experience on the Paraná River, offering stunning views of the city and the surrounding landscapes.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(31, 'en', 'Monument to the “Malvinas Veterans”', 'This monument honors the Argentine soldiers who participated in the 1982 Falklands War. It represents an eternal recognition of their bravery, dedication, and commitment to the homeland. It is a space for memory and reflection, where the fallen are honored and the sacrifice of those who returned is valued.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(32, 'en', 'Ñañua Monument', 'The sculpture symbolizes the embrace between two “Ñañuã” peoples. The work stands 9.20 meters tall, and the architect was selected in the “La Frontera nos une” contest organized by the Entity, aiming for the winning sculpture to become an urban and innovative landmark that contributes to the recognition of the identity and cultural significance of public space, highlighting the integration and brotherhood of the peoples of Argentina and Paraguay.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(33, 'en', 'Statue of Saint Roque González de Santa Cruz', 'Roque González de Santa Cruz was a young martyr and the first Paraguayan saint, born in Asunción (now Paraguay). He founded several reductions, including the cities of Posadas and Encarnación.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(34, 'en', 'Memory Site, Plaza and Monument to University Reform', 'This monument honors Truth and Memory in the Plaza of University Reform. It is an open space with a central element that proposes the exercise of memory as a collective construction. The Plaza Reforma Universitaria, located on Corrientes Avenue, is situated where the UNaM dining hall operated for many years.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(35, 'en', 'Monument to the Holy Scriptures', 'Surrounded by flower beds, the structure erected in honor of the Holy Scriptures features two front entrance paths, each with plaques bearing biblical passages “for meditation”. The supports simulate the two bronze pillars that stood at the entrance of the Jerusalem Temple: the right one was named Jachin, and the left one Boaz.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(36, 'en', 'Posadas Sign', 'The “Posadas” sign is a monumental billboard with the city’s name, strategically located on the waterfront, facing the Paraná River. Designed as a symbol of local identity and urban pride, this spot has become a favorite for both residents and tourists seeking an unforgettable photo of their visit to the capital of Misiones.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(37, 'en', 'Cerro Pelón Viewpoint', 'Cerro Pelón is the first witness to the birth of the city that grew alongside the Paraná River. This place is very close to what is and was the Bajada Vieja and its inhabitants.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(38, 'en', 'Arroyo Itá Urban Reserve', 'The Arroyo Itá Urban Nature Reserve is home to more than 140 species of birds, numerous tree species, and 40 varieties of fish. Additionally, various butterflies, insects, capybaras, coatis, and other animals inhabit the area.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(39, 'en', 'Flagpoles Square', 'Flagpoles Square is an iconic public space known for its collection of flagpoles that proudly fly national and provincial flags. It is located just meters from the San Roque González de Santa Cruz International Bridge.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(40, 'en', 'Festival Park', 'Festival Park is a green space designed for gatherings, celebrations, and recreation of the entire community. Its name reflects the festive and participatory spirit of the place, where cultural events, fairs, shows, and outdoor activities take place throughout the year. Surrounded by trees and wide open spaces, it is ideal for enjoying with family or friends, whether on rest days or during popular festivities.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(41, 'en', 'El Brete Amphitheater Square', 'An amphitheater located in the last section built of the waterfront, on the shores of El Brete Bay, from which it gets its name. It is situated in a square that features green spaces to enjoy the day.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(42, 'en', 'The Boatyard', 'It recalls what existed until the 1950s just a few meters from this location where the mural is found—a boatyard that provided services and maintenance to the vessels navigating the Paraná River waters.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(43, 'en', 'The Mensú', 'This site honors the key figure of the so-called “extractive economy”, precisely because the mensú were the workers responsible for extracting goods provided by the jungle, such as yerba mate and timber.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(44, 'en', 'Mural “Path to the Mensú”', 'This mural, crafted using the mosaic technique, depicts a mensú floating in the water with a bloodstained mantle detaching from his abdomen. This alludes to the times when it was common to see the bodies of rebellious mensú workers floating on the Paraná River waters, as the arduous and enslaving work in the Alto Paraná jungles often led to complaints and rebellions that were suppressed by the overseers, who would impunely kill the workers and throw them into the river.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(45, 'en', 'Waterfront Mural', 'The mural consists of two parts: one intervened with paint as a grand narrative telling the history of the area from the Guaraníes and Jesuits to the present day, and another of 160 square meters on the same theme but made with black pencil, which achieved the Guinness World Record in 2018.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(1, 'pt', 'Casa do Governo', 'É um dos lugares institucionais mais importantes da Província de Misiones, pois todas as principais questões que ocorrem no território provincial são tratadas aqui. Também é a sede física onde a maior autoridade, o Governador, exerce suas funções.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(2, 'pt', 'Catedral de São José', 'A Catedral de Posadas apresenta alinhamentos da arquitetura romântica, tanto francesa quanto italiana. As torres, com seus capitéis elaborados, terminam em cruzes de ferro, enquanto a aparência geral do templo é basilical. A construção foi concluída em 1937.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(3, 'pt', 'Parque Paraguaio', 'Historicamente, era um mirante da cidade de Posadas, localizado na ponta norte da cidade. Durante muitos anos, foi o único mirante da cidade, proporcionando contato visual direto com a costa do país vizinho. Seu nome deve-se ao monumento erguido pelo povo paraguaio.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(4, 'pt', 'Avenida Costaneira Monseñor J. Kemerer', 'Esta avenida percorre a margem do Rio Paraná na cidade de Posadas e é uma das áreas mais importantes da cidade. Ao longo desta avenida, os visitantes podem encontrar diversos pontos de interesse.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(5, 'pt', 'Museu Regional Aníbal Cambas', 'O museu possui coleções das culturas Alto Paraná, Umbú, Eldoradense, Tupí-Guarani, Guayakí e Jesuítico-Guarani, além de exposições sobre a Idade Contemporânea na província. É o museu mais antigo da cidade.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(6, 'pt', 'Anfiteatro Manuel Antonio Ramírez', 'Nos últimos anos, tem sido palco de vários festivais e espetáculos, como o Festival Nacional da Música do Litoral e a Estudiantina. Tem capacidade para 4.000 pessoas e oferece um espaço para apresentações de todos os tipos, com o Rio Paraná como pano de fundo.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(7, 'pt', 'Jardim Botânico Alberto Roth', 'Os jardins botânicos servem como reservas ecológicas para garantir uma melhor qualidade de vida às espécies que os habitam. Eles oferecem um refúgio para várias espécies, incluindo algumas ameaçadas de extinção, e também um espaço aberto para pesquisa e educação. O local possui trilhas para os visitantes.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(8, 'pt', 'Passeio Bosetti', 'Possui painéis criados por artistas plásticos retratando a história da cidade, além de um monumento ao "Matero" (pessoa que bebe mate). Uma fonte com cascata, quedas d’água naturais e uma mistura de árvores nativas e exóticas completam este belo passeio. Também possui conexão direta com o Palácio do Mate e o Museu de Belas Artes, formando um marco importante no centro de Posadas. Artesãos também podem vender seus produtos aqui.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(9, 'pt', 'Passeio Cultural La Terminal', 'O antigo terminal de ônibus da cidade estava localizado na esquina de uma das avenidas do centro. Com o crescimento da cidade, tornou-se pequeno, levando à sua realocação. Este espaço foi transformado no que hoje é conhecido como Passeio Cultural La Terminal, onde turistas podem desfrutar de diferentes apresentações artísticas e atividades culturais.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(10, 'pt', 'Pedra Fundacional Itapúa', 'A pedra fundamental de Posadas marca o local aproximado onde, em 25 de março de 1615, foi fundada a Redução Jesuítica de mesmo nome. É considerada o antecedente histórico mais significativo do que mais tarde se tornaria a cidade de Posadas.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(11, 'pt', 'Praça 9 de Julho', 'A Praça 9 de Julho apresenta a tradicional Estátua da Liberdade e uma diversificada exibição da vegetação nativa de Misiones. Está localizada em frente à Casa do Governo, à Catedral, a hotéis modernos, bancos e edifícios comerciais.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(12, 'pt', 'Praça San Martín', 'Nesta praça encontra-se a estátua do Libertador da América, o General José Francisco de San Martín, além de belos jardins e parques infantis. Está localizada em frente ao Instituto Superior Antonio Ruiz de Montoya, a primeira instituição de ensino superior da província de Misiones.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(13, 'pt', 'Reserva Urbana Rincón Nazarí', 'É única no seu tipo dentro da província de Misiones. Sendo uma iniciativa privada, está localizada a poucas quadras do centro de Posadas.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(14, 'pt', 'Museu Histórico e Arqueológico Andrés Guacurarí', 'Localizado no centro da cidade, o museu exibe artefatos das culturas Alto Paraná, Mocoretá, Eldoradense, Tupí-Guarani, bem como objetos das missões Jesuítico-Guaranis.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(15, 'pt', 'Museu Municipal de Belas Artes Lucas Braulio Areco - Palácio do Mate', 'O museu apresenta vários dioramas e fotografias ilustrando a evolução histórica da cidade e seus arredores. Também exibe pinturas e esculturas de artistas locais, além de objetos antigos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(16, 'pt', 'Museu Provincial Juan Yaparí', 'As salas de exposição do Museu Provincial de Belas Artes Juan Yaparí apresentam exposições temporárias com o objetivo de promover, divulgar e valorizar a produção dos artistas plásticos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(17, 'pt', 'Praia El Brete', 'É uma praia fluvial às margens do Rio Paraná, localizada perto do centro da cidade. Oferece atividades recreativas, como caiaque e quadras esportivas. Há também restaurantes próximos com diversas opções gastronômicas.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(18, 'pt', 'Costa Sul', 'Localizada na entrada sul de Posadas, esta área é um dos locais autorizados para atividades recreativas e de praia na costa do Rio Paraná. Os visitantes podem desfrutar da praia, gastronomia e esportes em um único local.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(19, 'pt', 'Parque La Cantera (Cascata)', 'É uma cascata artificial com uma queda d’água de quinze metros de altura, cercada por uma praça. Está localizada na histórica pedreira da empresa Enríquez, que dá nome ao local. O espaço permite a realização de eventos e atividades ao ar livre. Famílias costumam se reunir aqui para aproveitar a tarde com vista para o rio.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(20, 'pt', 'Monumento a Andresito Guacurarí', 'É uma impressionante estrutura de aço inoxidável localizada no segundo trecho da costaneira, próximo à rotatória da Bajada Vieja. Com 17 metros de altura e 6 toneladas de peso, tem vista para a cidade de Posadas e para o Rio Paraná ao fundo. É o ponto mais fotografado da cidade.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(21, 'pt', 'Mirante da Rua Moritán', 'Este mirante, construído sobre um penhasco natural com vista para o Rio Paraná, oferece uma vista panorâmica privilegiada de várias partes da cidade e até mesmo de Encarnación, no Paraguai.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(22, 'pt', 'Escadaria Pintada', 'É uma cascata pintada nos degraus da Costaneira, destacando a majestade da natureza de Misiones. A obra ganha ainda mais vida nos dias chuvosos. Foi criada pelo artista Bernardo Neumann em 2016.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(23, 'pt', 'Antiga Estação de Trem (Villa Cultura La Estación)', 'O edifício é uma réplica exata da estação de trem original de Posadas, que foi o terminal do serviço Federico Lacroze - Posadas chamado "El Gran Capitán", inaugurado em 1913 e operado até 2011. Foi declarado Patrimônio Cultural da cidade e agora é usado para exposições artísticas e culturais.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(24, 'pt', 'Píer dos Pescadores', 'É um píer que se estende alguns metros sobre o Rio Paraná, próximo a El Brete. Oferece vistas extraordinárias do país vizinho e é um excelente local para observar o pôr do sol.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(25, 'pt', 'Mirante da Estação', 'Uma passarela sobre o Rio Paraná que proporciona uma bela vista do rio e da cidade. Também oferece uma perspectiva diferente da Avenida Costaneira e do Paraguai.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(26, 'pt', 'Templo Budista Rattanarngsiyaram', 'O templo budista da comunidade laosiana da cidade. O Wat Lao Rattanarangsyaram Keosawang abriga o maior Buda da América Latina, com 14 metros de altura.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(27, 'pt', 'Praça El Papa', 'Localizada onde antes ficava o antigo porto da cidade, esta pequena praça oferece uma vista panorâmica do rio em meio ao movimentado ambiente da costaneira. É um ponto de encontro para jovens e adultos.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(28, 'pt', 'Sociedade Italiana', 'Fundada em 1898 para promover a cultura italiana e preservar suas tradições, esta sociedade adquiriu um terreno na Rua Bolívar em 1912 para a construção de sua sede social. A pedra fundamental foi lançada em 1923. A Sociedade Italiana de Socorros Mútuos continua suas atividades até hoje.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(29, 'pt', 'Caiaque', 'Uma atividade recreativa disponível no Rio Paraná, oferecendo aos visitantes a oportunidade de explorar as águas e apreciar a paisagem natural.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(30, 'pt', 'Macro Bike', 'Um serviço de aluguel de bicicletas que permite aos visitantes explorar a cidade de Posadas de forma ecológica e ativa.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(31, 'pt', 'Catamarã', 'Uma experiência de passeio de barco pelo Rio Paraná, proporcionando vistas deslumbrantes da cidade e das paisagens ao redor.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(31, 'pt', 'Monumento aos “Veteranos das Malvinas”', 'Este monumento presta homenagem aos soldados argentinos que participaram da Guerra das Malvinas de 1982. Representa um reconhecimento eterno à sua coragem, dedicação e compromisso com a pátria. É um espaço de memória e reflexão, onde se homenageia os que caíram e se valoriza o sacrifício dos que retornaram.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(32, 'pt', 'Monumento Ñañua', 'A escultura simboliza o abraço entre dois povos “Ñañuã”. A obra tem 9,20 metros de altura e o arquiteto foi eleito no concurso “A Fronteira nos Une”, com a ideia de que a escultura vencedora se tornasse um marco urbano e inovador, contribuindo para o reconhecimento da identidade e do significado cultural do espaço público, destacando a integração e a irmandade entre os povos da Argentina e do Paraguai.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(33, 'pt', 'Estátua de São Roque González de Santa Cruz', 'Roque González de Santa Cruz foi um jovem mártir e o primeiro santo paraguaio, nascido em Assunção, no atual Paraguai. Fundador de várias reduções, entre elas as cidades de Posadas e Encarnación.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(34, 'pt', 'Sítio da Memória, praça e monumento à Reforma Universitária', 'É um monumento em homenagem à Verdade e à Memória, localizado na praça da Reforma Universitária. É um espaço aberto com um elemento central que propõe o exercício da memória como uma construção coletiva. A praça, situada na avenida Corrientes, foi durante muitos anos o local do refeitório da UNaM.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(35, 'pt', 'Monumento às Sagradas Escrituras', 'Cercada por canteiros de flores, a construção erguida em homenagem às Sagradas Escrituras possui dois caminhos de entrada frontal, onde há placas com passagens bíblicas “para meditar”. Os suportes simulam os dois pilares de bronze que ficavam no pórtico do Templo de Jerusalém: o da direita se chamava Jaquin e o da esquerda, Boaz.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(36, 'pt', 'Letreiro de Posadas', 'O letreiro “Posadas” é uma placa monumental com o nome da cidade, localizada estrategicamente na orla, de frente para o rio Paraná. Pensado como um símbolo de identidade local e orgulho urbano, esse ponto se tornou um dos preferidos por moradores e turistas que desejam levar uma foto inesquecível da capital missioneira.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(37, 'pt', 'Mirante do Cerro Pelón', 'O Cerro Pelón é a primeira testemunha do nascimento da cidade que cresceu às margens do rio Paraná. Este lugar fica muito próximo e ligado ao que é e foi a Bajada Vieja e seus habitantes.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(38, 'pt', 'Reserva Urbana Arroyo Itá', 'Na reserva natural urbana Arroyo Itá vivem mais de 100 espécies de aves, várias de árvores e 40 variedades de peixes. Também se encontram borboletas, insetos, cuíes, capivaras e lagartos overos, entre outros animais.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(39, 'pt', 'Praça dos Mastros', 'A Praça dos Mastros é um espaço público emblemático, conhecido por seu conjunto de mastros que orgulhosamente hasteiam as bandeiras nacionais e provinciais. Fica a poucos metros da Ponte Internacional San Roque González de Santa Cruz.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(40, 'pt', 'Parque das Festas', 'O Parque das Festas é um espaço verde pensado para o encontro, celebração e lazer de toda a comunidade. Seu nome reflete o espírito festivo e participativo do local, onde são realizados eventos culturais, feiras, espetáculos e atividades ao ar livre durante todo o ano. Cercado por árvores e amplos espaços abertos, é ideal para aproveitar com a família ou amigos, seja em momentos de descanso ou festas populares.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(41, 'pt', 'Praça Anfiteatro El Brete', 'Anfiteatro localizado no último trecho construído da orla, às margens da baía El Brete, de onde recebe seu nome. Está situado em uma praça com áreas verdes para aproveitar o dia.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(42, 'pt', 'O Estaleiro', 'Recorda o que até a década de 1950 existia a poucos metros do local onde está o mural: um estaleiro que prestava serviços e fazia a manutenção das embarcações que navegavam pelo rio Paraná.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(43, 'pt', 'O Mensú', 'Este local homenageia o personagem fundamental da chamada “economia extrativa”, pois os mensús eram os operários encarregados de extrair os recursos fornecidos pela selva, como a erva-mate e a madeira.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(44, 'pt', 'Mural Caminho ao Mensú', 'Este mural, feito com a técnica de mosaico, representa um mensú flutuando na água com um manto de sangue saindo de seu ventre. Isso faz alusão ao fato de que, na época, era comum ver cadáveres de mensús rebeldes flutuando nas águas do rio Paraná, já que o trabalho escravizante nas selvas do Alto Paraná gerava protestos e revoltas, que eram sufocados pelos kapangas, capatazes dos obrajes, que impunemente assassinavam os trabalhadores e os lançavam ao rio.');
INSERT INTO punto_de_interes_traducciones (id_punto_de_interes, idioma, nombre_punto_de_interes, descripcion) VALUES(45, 'pt', 'Mural da Costanera', 'O mural é composto por duas partes: uma pintada como um grande relato que conta a história da região desde os guaranis e jesuítas até os dias atuais; e outra de 160 metros quadrados sobre o mesmo tema, mas feita com lápis preto, a qual conquistou o recorde Guinness em 2018.');
